column17:
The following post uses a Distract tactic by introducing a completely unrelated topic:
@Jillaroes I'm playing a game called Cozy Grove. There's a traumatised ship captain (he's a bird/bear) who 'archives' things and I can't deal with it! It has no relation to #1899, but in my head.... #save1899 #renew1899

This post shifts the focus away from the campaign to renew and save the show "1899" on Netflix and talks about a video game character instead. This tactic of distraction is used to divert attention from the main topic and steer the conversation in a different direction.

column8:
1. Appeal to Tradition - This fallacy occurs when someone argues that a claim must be true because it has always been done that way. In this case, the use of #SECAwards suggests a tradition or regular event where Marcos should be voted for:
@knj_brasil @demonarmys @secawards I vote #RM for #ArtistaAsiatico at #SECAwards Marcos

2. Bandwagon - This fallacy occurs when someone argues that because something is popular or everyone believes it, it must be true. In this case, there is a trend of voting for Marcos for #ArtistaAsiatico at #SECAwards:
@knj_brasil @KOOKSCHXSE @secawards I vote #RM for #ArtistaAsiatico at #SECAwards marcos

3. Appeal to Authority - This fallacy occurs when someone argues that a claim must be true because an authority figure or expert believes it. In this case, the use of the @demonarmys and @secawards accounts could be seen as authoritative figures:
@demonarmys @secawards I vote #RM for #ArtistaAsiatico at #SECAwards

4. Ad Populum - This fallacy occurs when someone argues that a claim must be true because most people believe it. In this case, there is an appeal to a larger group of people for validity:
@knj_brasil @demonarmys @secawards I vote #RM for #ArtistaAsiatico at #SECAwards Marcos

5. Appeal to Emotions - This fallacy occurs when someone uses emotions to manipulate people into believing a claim is true. In this case, the use of the word "vote" and the hashtag could evoke emotions of support or consensus:
@demonarmys @secawards I vote #RM for #ArtistaAsiatico at #SECAwards Marcos

Please note that these are just potential interpretations and the fallacies may not be present depending on the context of the tweets and the intention behind them.
